description:
Verenigd Koninkrijk
Thriller
90 minuten

goed

met Cillian Murphy, Thandie Newton en Jamie Bell

In een laatste poging om hun huwelijk te redden vestigen Martin en Kate Badenoch zich op het prachtige onbewoonde eiland 
Dinnish in het Verenigd Koninkrijk, een plek waar ze ooit een romantische vakantie doorgebracht hebben. Op een dag spoelt na 
een hevige storm een Amerikaanse soldaat aan op het strand, die een beschermend pak tegen biologische wapens draagt. 
Communicatie met het vasteland is niet meer mogelijk. De soldaat brengt het nieuws dat er een catastrofale ramp heeft 
plaatsgevonden en iedereen is gedood door een virus dat zich door de lucht verspreidt. Maar wie is deze soldaat?
